int Callwebservice::calling(string endpoint, string name, vector<string>& params, string& ret) {
	KIF_USCOREBinding0Proxy* webclient = (KIF_USCOREBinding0Proxy*)client;
	const char* end = NULL;
	if (endpoint.size() != 0)
		end = endpoint.c_str();

	int res = 0;
	switch (params.size()) {
	case 0:
		res = webclient->callKIF0(end, NULL, name, ret);
		break;
	case 1:
		res = webclient->callKIF1(end, NULL, name, params[0], ret);
		break;
	case 2:
		res = webclient->callKIF2(end, NULL, name, params[0], params[1], ret);
		break;
	case 3:
		res = webclient->callKIF3(end, NULL, name, params[0], params[1], params[2], ret);
		break;
	case 4:
		res = webclient->callKIF4(end, NULL, name, params[0], params[1], params[2], params[3], ret);
		break;
	case 5:
		res = webclient->callKIF5(end, NULL, name, params[0], params[1], params[2], params[3], params[4], ret);
	}

	if (res) {		
		webclient->soap_sprint_fault(buff, 2048);
		ret = buff;
		return -1;
	}

	return SOAP_OK;
}

int Callwebservice::getmethods(string endpoint,string& ret) {
	KIF_USCOREBinding0Proxy* webclient = (KIF_USCOREBinding0Proxy*)client;
	const char* end = NULL;
	if (endpoint.size() != 0)
		end = endpoint.c_str();

	int reterr = webclient->MethodsResponse(end, NULL, ret);
	if (reterr) {
		webclient->soap_sprint_fault(buff, 2048);
		ret = buff;
		return -1;
	}
	return SOAP_OK;
}

string Callwebservice::hostport() {
	std::ostringstream os;
	os << host << ":" << port;
	return os.str();
}

Callwebservice::Callwebservice(void* ksrv,bool choose) {
	client = NULL;
	buff[0] = 0;
	if (choose==false) {
		KIF_USCOREBinding0Proxy* webclient = new KIF_USCOREBinding0Proxy;
		client = (void*)webclient;
	}

	port = -1;
	kifservice = ksrv;
}

Callwebservice::~Callwebservice() {
	if (client != NULL) {
		KIF_USCOREBinding0Proxy* webclient = (KIF_USCOREBinding0Proxy*)client;
		delete webclient;
	}
}

int Callwebservice::run(string hst, int prt) {
	host = hst;
	port = prt;

	cerr << hostport() << endl;
	KIF_USCOREBinding0Service webserve;
	webserve.data = this;

	int m = webserve.bind(host.c_str(), port, 100);

	if (!soap_valid_socket(m)) {
		webserve.soap_sprint_fault(buff, 2048);
		return -1;
	}

	int c = webserve.accept();
	if (!soap_valid_socket(c)) {
		webserve.soap_sprint_fault(buff, 2048);
		return -1;
	}
	
	if (webserve.serve()) {
		webserve.soap_sprint_fault(buff, 2048);
		return -1;
	}

	return SOAP_OK;
}

